import React from "react";
import crypto from 'crypto-js';
import { dict } from "../../Dict";
import Moment from 'react-moment';
import 'moment-timezone';

const MeetingCard = (props) => {
    function meetingItems() {
        var result = []
        props.meetings.map((meeting) => {
            result.push(
                <div>
                    <div className="row">
                        <div className="col-auto">
                            <span className="avatar">JL</span>
                        </div>
                        <div className="col">
                            <div className="text-truncate">
                                <strong>{meeting.title}</strong>
                            </div>
                            <div className="text-muted"> 
                            <Moment parse="YYYY-MM-DD HH:mm">{meeting.start_date}</Moment>
                            </div>
                        </div>
                        <div className="col-auto align-self-center">
                            <div className="badge bg-primary"></div>
                        </div>
                    </div>
                </div>
            )
        })
        return result
    }
    return (
        <div className="col-md-8">
            <div className="card" style={{ height: '24rem' }}>
                <div className="card-header" style={{ display: 'initial' }}>
                    <a href="/#/meetings/create?event_id=4" class="btn btn-primary" style={{ float: 'right' }}>
                        <svg xmlns="http://www.w3.org/2000/svg" class="icon" width="24" height="24" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" fill="none" stroke-linecap="round" stroke-linejoin="round"><path stroke="none" d="M0 0h24v24H0z" fill="none" /><line x1="3" y1="4" x2="21" y2="4" /><path d="M4 4v10a2 2 0 0 0 2 2h12a2 2 0 0 0 2 -2v-10" /><line x1="12" y1="16" x2="12" y2="20" /><line x1="9" y1="20" x2="15" y2="20" /><path d="M8 12l3 -3l2 2l3 -3" /></svg>
                        Create a meeting
                    </a>
                </div>
                <div className="card-body card-body-scrollable card-body-scrollable-shadow">
                    <div className="divide-y">
                        {meetingItems()}
                    </div>
                </div>
            </div>
        </div>
    )
}
export default MeetingCard;
